void quick(int a[], int start, int end)
{
  int p;
  int i;
  if (start < end)
  {
    p = partition(a, start, end);
    quick(a, start, p - 1);
    quick(a, p + 1, end);
  }

}

int partition(int a[], int start, int end)
{
  int pivot;
  int p;
  int t;
  int k;
  int i;
  pivot = a[end];
  p = start;
  for (i = start; i <= (end - 1); i++)
  {
    if (a[i] <= pivot)
    {
      t = a[i];
      a[i] = a[p];
      a[p] = t;
      p = p + 1;
    }

  }

  k = a[p];
  a[p] = a[end];
  a[end] = k;
  return p;
}

